import React, { useState } from "react";

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Button from "react-bootstrap/Button";

function LogIn(props) {
  const [user, setUser] = useState({ username: "", password: "" });
  const login = evt => {
    evt.preventDefault();
    props.login(user.username, user.password);
  };
  const onChange = evt => {
    user[evt.target.id] = evt.target.value;
    setUser({ ...user });
  };
  return (
    <Container>
      <Row>
        <Col md="4">

          <Form onSubmit={login} onChange={onChange}>
            <h3>Login</h3>
            <Form.Control placeholder="User Name" id="username" /><br />
            <Form.Control placeholder="Password" id="password" /><br />
            <Button>Login</Button>
          </Form>
        </Col>
      </Row>
    </Container>
  );
}
export default LogIn;
